var title_f14_50_15138="NEC prematurity";
var content_f14_50_15138=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F68015&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F68015&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Necrotizing enterocolitis: Susceptibility of premature infants",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 448px; height: 272px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Immaturity of the intestinal epithelial barrier and the neonatal mucosal immune system predispose the premature infant to microbial invasion, which triggers the sequence of events leading to necrotizing enterocolitis (NEC). Stimulation of pro-inflammatory cytokines compromises intestinal defenses. An imbalance between epithelial cell injury and repair leads to cycle of bacterial invasion, immune activation, uncontrolled inflammation, and gut barrier failure.",
"    <div class=\"footnotes\">",
"     NO: nitric oxide; TNF-&alpha;: tumor necrosis factor - alpha.",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Hunter CJ, Upperman JS, Ford HR, Camerini V. Understanding the susceptibility of the premature infant to necrotizing entercolitis (NEC). Pediatr Res 2008; 63:117. Copyright &copy; 2008 Lippincott Williams &amp; Wilkins.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
