" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Enteroatmospheric fistula",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 432px; height: 324px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Enteroatmospheric or exposed fistulas occur in the midst of an open abdomen with no overlying soft tissue. These fistulas occur when the abdomen is left open after trauma or emergency surgery. This photograph shows the appearance of superficial exposed fistulas draining atop the granulating wound of a frozen abdomen with an obliterated peritoneal cavity.",
