"   <div class=\"block pha drugH1Div\" id=\"F1061533\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Mechanism of Action",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Inhibits the synthesis of thyroid hormones by blocking the oxidation of iodine in the thyroid gland; blocks synthesis of thyroxine and triiodothyronine",
"    </p>",
"   </div>",
"   <div class=\"block phd drugH1Div\" id=\"F1061549\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pharmacodynamics",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     For significant therapeutic effects 24-36 hours are required; remission of hyperthyroidism usually does not occur before 4 months of continued therapy",
"    </p>",
"   </div>",
"   <div class=\"block phk drugH1Div\" id=\"F1061550\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pharmacokinetics (Adult data unless noted)",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Protein binding: 75% to 80%",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Metabolism: Hepatic",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Bioavailability: 80% to 95%",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Half-life: 1.5-5 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     End-stage renal disease: 8.5 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Time to peak serum concentration: Oral: Within 1 hour; persists for 2-3 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Elimination: 35% excreted in urine",
"    </p>",
"   </div>",
"   <div class=\"block pai drugH1Div\" id=\"F1061540\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Patient Information",
"    </span>",
"    <p>",
"     (For additional information",
"     <a class=\"drug drug_patient\" href=\"UTD.htm?29/31/30196?source=see_link\">",
"      see \"Propylthiouracil: Patient drug information\"",
"     </a>",
"     )",
"    </p>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Do not exceed prescribed dosage; take at regular intervals around-the-clock; notify physician or pharmacist if fever, sore throat, unusual bleeding or bruising, headache, nausea, vomiting, loss of appetite, itchiness, dark-colored urine, yellowing of your skin or eyes, tiredness, or general malaise occurs; be aware that severe liver injury has occurred in patients taking propylthiouracil",
"    </p>",
"   </div>",
"   <div class=\"block exp drugH1Div\" id=\"F215052\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Extemporaneous Preparations",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     A 5 mg/mL oral suspension may be made with tablets and a 1:1 mixture of Ora-Plus&reg; and Ora-Sweet&reg;. Crush twenty 50 mg propylthiouracil tablets in a mortar and reduce to a fine powder. Add small portions of vehicle and mix to a uniform paste; mix while adding vehicle in incremental proportions to",
"     <b>",
"      almost",
"     </b>",
"     200 mL; transfer to a calibrated bottle, rinse mortar with vehicle, and add quantity of vehicle sufficient to make 200 mL. Label \"shake well\" and \"refrigerate\". Stable for 91 days refrigerated (preferred) and 70 days at room temperature.",
"    </p>",
"    <div class=\"reference\">",
"     Nahata MC, Pai VB, and Hipple TF,",
"     <i>",
"      Pediatric Drug Formulations",
"     </i>",
"     , 5th ed, Cincinnati, OH: Harvey Whitney Books Co, 2004.",
"    </div>",
"   </div>",
