"   <div class=\"block pha drugH1Div\" id=\"F206554\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Mechanism of Action",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Paroxetine is a selective serotonin reuptake inhibitor, chemically unrelated to tricyclic, tetracyclic, or other antidepressants; presumably, the inhibition of serotonin reuptake from brain synapse stimulated serotonin activity in the brain",
"    </p>",
"   </div>",
"   <div class=\"block phk drugH1Div\" id=\"F206573\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pharmacodynamics/Kinetics",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Onset of action: Depression: The onset of action is within a week; however, individual response varies greatly and full response may not be seen until 8-12 weeks after initiation of treatment.",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Absorption: Completely absorbed following oral administration",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Distribution: V",
"     <sub>",
"      d",
"     </sub>",
"     : 8.7 L/kg (3-28 L/kg)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Protein binding: 93% to 95%",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Metabolism: Extensively hepatic via CYP2D6 enzymes; primary metabolites are formed via oxidation and methylation of parent drug, with subsequent glucuronide/sulfate conjugation; nonlinear pharmacokinetics (via 2D6 saturation) may be seen with higher doses and longer duration of therapy. Metabolites exhibit ~2% potency of parent compound. C",
"     <sub>",
"      min",
"     </sub>",
"     concentrations are 70% to 80% greater in the elderly compared to nonelderly patients; clearance is also decreased.",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Half-life elimination: 21 hours (3-65 hours)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Time to peak: Immediate release: 5.2-8.1 hours; controlled release: 6-10 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Excretion: Urine (64%, 2% as unchanged drug); feces (36% primarily via bile, &lt;1% as unchanged drug)",
"    </p>",
"   </div>",
