var title_f14_50_15148="MSI testing Bethesda";
var content_f14_50_15148=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=GAST%2F50889&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=GAST%2F50889&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Recommendations for the process of molecular evaluation of patients identified as being at risk, based on meeting the Bethesda guidelines",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Process of molecular evaluation:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        1. The optimal approach to evaluation is microsatellite instability (MSI) or immunohistochemical (IHC) analysis* of tumors, followed by germline MSH2/MLH1 testing in patients with MSI-H tumors or tumors with a loss of expression of one of the mismatch repair genes&bull;.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        2. After the mutation is identified, at-risk relatives should be referred for genetic counseling and tested if they wish.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        3. An alternative approach, if tissue testing is not feasible, is to proceed directly to germline analysis of the MSH2/MLH1 genes.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        4. If no mismatch repair gene mutation is found in a proband with an MSI-H tumor and/or clinical history of hereditary nonpolyposis colorectal cancer (HNPCC), the genetic test result is non-informative. The patients and the at-risk individuals (ie, relatives) should be counseled as if HNPCC was confirmed and high-risk surveillance should be undertaken.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        5. There is need to assure patients of confidentiality to allay fears related to discrimination based on genetic status.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     MSI-H: microsatellite instability-high in tumors refers to changes in two or more of the five National Cancer Institute (NCI)-recommended panels of microsatellite markers. MSI-L: microsatellite instability-low in tumors refers to changes in only one of the five NCI-recommended panels of microsatellite markers.",
"     <br>",
"      * Standard mutation detection techniques include single-strand conformational polymorphism, denaturing gradient gel-electrophoresis analysis, and DNA sequencing. Alternative mutation detection techniques include monoallelic expression analysis, Southern analysis, and quantitative polymerase chain reaction; these methods may detect certain mutations such as large genomic rearrangements that may be missed by more conventional mutation detection methods.",
"      <br>",
"       &bull; For families with a strong suspicion of HNPCC, germline testing should be considered, even when the MSI/IHC results indicate MSI-L, microsatellite stable, or normal expression. The likelihood of finding a germline mutation in the MLH1/MSH2 genes of patients with colorectal cancer tumors that are not MSI-H is expected to be low; however, this likelihood has not been thoroughly studied.",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Umar, A, et al. J Natl Cancer Inst 2004; 96:261. Copyright &copy; 2004 Oxford University Press.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
