var title_f14_50_15149="Clues to the etiology of septic arthritis in children";
var content_f14_50_15149=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F75192&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F75192&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Clinical features associated with bacterial pathogens that cause arthritis in children",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        &nbsp;",
"       </td>",
"       <td class=\"subtitle1\">",
"        Clinical features",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Gram-positive bacteria",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <em>",
"         Staphylococcus aureus",
"        </em>",
"       </td>",
"       <td>",
"        All ages; may cause polyarticular infection; MRSA may be associated with venous thromboembolism and pulmonary disease; possible associated skin or soft tissue infection",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Coagulase-negative staphylococci",
"       </td>",
"       <td>",
"        Most common cause of bacterial arthritis associated with prosthetic joints",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Group A streptococcus (",
"        <em>",
"         S. pyogenes",
"        </em>",
"        )",
"       </td>",
"       <td>",
"        Concurrent varicella zoster virus infection",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <em>",
"         Streptococcus pneumoniae",
"        </em>",
"        (pneumococcus)",
"       </td>",
"       <td>",
"        Children younger than two years of age; children older than two years of age with underlying medical condition (eg, sickle cell disease, immunodeficiency, etc)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Group B streptococcus (",
"        <em>",
"         Streptococcus agalactiae",
"        </em>",
"        )",
"       </td>",
"       <td>",
"        Infants younger than three months of age",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <em>",
"         Nocardia asteroides",
"        </em>",
"       </td>",
"       <td>",
"        Chronic monoarticular arthritis with a granulomatous reaction",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Gram-negative bacteria",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <em>",
"         Kingella kingae",
"        </em>",
"       </td>",
"       <td>",
"        Children younger than 36 months, indolent onset",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <em>",
"         Haemophilus influenzae",
"        </em>",
"        type b (Hib)",
"       </td>",
"       <td>",
"        Incompletely immunized children in areas with low Hib immunization rates",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" rowspan=\"2\">",
"        <em>",
"         Neisseria gonorrhoeae",
"        </em>",
"       </td>",
"       <td>",
"        Newborns; usually affects joints below the hip; may cause polyarticular infection",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Sexually active adolescents; usually occurs as part of disseminated infection with fever and rash; in girls may precede onset of menses",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <em>",
"         Neisseria meningitidis",
"        </em>",
"       </td>",
"       <td>",
"        May cause polyarticular infection; associated rash",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <em>",
"         Salmonella",
"        </em>",
"        species",
"       </td>",
"       <td>",
"        Children with sickle cell disease or related hemoglobinopathies",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Non-salmonella gram-negative bacilli",
"       </td>",
"       <td>",
"        Newborns; instrumentation of the gastrointestinal or urinary tract; immunocompromised host",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <em>",
"         Pseudomonas aeruginosa",
"        </em>",
"       </td>",
"       <td>",
"        Puncture wounds; injectable drug use",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <em>",
"         Streptococcus moniliformis",
"        </em>",
"        (rat bite fever)",
"       </td>",
"       <td>",
"        Rat bite; macular rash at time of presentation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <em>",
"         Borrelia burgdorferi",
"        </em>",
"        (Lyme disease)",
"       </td>",
"       <td>",
"        Tick bite; history of erythema migrans rash; travel to or living in an endemic area; intermittent inflammatory arthritis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <em>",
"         Brucella",
"        </em>",
"       </td>",
"       <td>",
"        Travel to or living in an endemic area; ingestion of unpasteurized dairy products; chronic monoarticular arthritis with a granulomatous reaction",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Mycobacteria (tuberculosis and atypical species)",
"       </td>",
"       <td>",
"        Chronic monoarticular arthritis with a granulomatous reaction",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     MRSA: methicillin-resistant",
"     <em>",
"      S. aureus",
"     </em>",
"     .",
"    </div>",
"    <div class=\"reference\">",
"     Data from: Krogstad P. Septic arthitis. In: Textbook of Pediatric Infectious Diseases, 6th ed, Feigin RD, Cherry JD, Demmler-Harrison GJ, Kaplan SL (Eds), Saunders, Philadelphia 2009. p.742.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
